def analyze_centile(name, parametr, centiles, age_key, gender=None, resultat=True):
    for centile_row in centiles:
        if float(centile_row['age']) == float(age_key):
            p3 = float(centile_row['p3'])
            p10 = float(centile_row['p10'])
            p25 = float(centile_row['p25'])
            p75 = float(centile_row['p75'])
            p90 = float(centile_row['p90'])
            p97 = float(centile_row['p97'])
            ME = float(centile_row.get('ME', 0))
            SD = float(centile_row.get('SD', 1)) or 1.0
            SDS = round((parametr - ME) / SD, 2)

            if parametr < p3:
                corridor = "ниже 3"
            elif p3 <= parametr < p10:
                corridor = "3-10"
            elif p10 <= parametr < p25:
                corridor = "10-25"
            elif p25 <= parametr <= p75:
                corridor = "25-75"
            elif p75 < parametr <= p90:
                corridor = "75-90"
            elif p90 < parametr <= p97:
                corridor = "90-97"
            else:
                corridor = "выше 97"
            if resultat:
                if corridor in ("ниже 3", "выше 97"):
                    print(f"{parametr} {name} в центильном коридоре {corridor} перцентиля, SDS = {SDS}.")
                else:
                    print(f"{parametr} {name} в {corridor}-м центильном коридоре, SDS = {SDS}.")
            return SDS, corridor

def harmony(rost_corridor, ves_corridor):
    key = (rost_corridor, ves_corridor)
    if key in fiz_razvitie:
        return fiz_razvitie[key]
    return f"Нет записи в физического развития для пары коридоров: {rost_corridor}, {ves_corridor}"

def narushenia(SDSrost, SDSves, SDSimt, age_years):
    if SDSrost <= -2:
        print(f"Низкорослость или хроническая белково-энергетическая недостаточность, умеренной степени (рост = {SDSrost} SDS)")
        return
    elif SDSrost >= 2:
        print(f"Высокорослость (рост = {SDSrost} SDS).")
        return
    if age_years < 5:
        if SDSves >= 3 or SDSimt >= 3:
            print(f"Ожирение (индекс массы тела = {SDSimt} SDS, вес = {SDSves} SDS).")
            return
        if SDSves >= 2 or SDSimt >= 2:
            print(f"Избыток массы тела (индекс массы тела = {SDSimt} SDS, вес = {SDSves} SDS).).")
            return
    else:
        if SDSimt > 2:
            print(f"Ожирение (индекс массы тела = {SDSimt} SDS).")
            return
        if SDSimt > 1:
            print(f"Избыток массы тела (индекс массы тела = {SDSimt} SDS).")
            return
    if age_years < 5:
        if SDSves <= -3 or SDSimt <= -3:
            print(f"Острая белково-энергетическая недостаточность, тяжёлой степени (индекс массы тела = {SDSimt} SDS, вес = {SDSves} SDS).")
            return
        if SDSves <= -2 or SDSimt <= -2:
            print(f"Острая белково-энергетическая недостаточность, умеренной степени (индекс массы тела = {SDSimt} SDS, вес = {SDSves} SDS).")
            return
    else:
        if SDSimt <= -3:
            print(f"Острая белково-энергетическая недостаточность, тяжёлой степени (индекс массы тела = {SDSimt} SDS).")
            return
        if SDSimt <= -2:
            print(f"Острая белково-энергетическая недостаточность, умеренной степени (индекс массы тела = {SDSimt} SDS).")
            return
    print("Нарушений не выявлено")

